import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六庚日丁丑时断</p><p>六庚日生时丁丑，贵地逢官火太轻；</p><p>木火运通轩冕客，不通独立只虚名。</p><p>庚日丁丑时，金重火轻。</p><p>庚以丁为官，以己为印，丑上丁火气轻，己土正位。</p><p>若通木火气月，官印逢生旺，贵；不通，虚名而已。</p><p>通火土生旺月，富；不通，运遇亦主名声。</p><p>庚子日丁丑时，春夏，贵；秋平常；冬孤克。</p><p>庚寅日丁丑时，魁元。</p><p>寅卯午未亥月，清秀高命。</p><p>行午、未运，贵显。</p><p>通火土年月，贵。</p><p>庚辰日丁丑时，丑月，富而寿促。</p><p>己，近侍，大贵。</p><p>通火旺土生月，贵；不得，运遇亦富，有名誉。</p><p>庚午日丁丑时，通土月气，贵；不，亦富，有名声。</p><p>庚申日丁丑时，丑月，金火运，极品。</p><p>辰巳午未戌月，官印两旺，贵。</p><p>申、酉，身太旺，须行木火。</p><p>寅、卯，财太旺，须行金水。</p><p>亥子，金寒水冷，须行火土运，贵。</p><p>庚戌日丁丑时，春财旺；夏官旺；秋平淡；冬无力。</p><p>庚丁相合丑时全，好象明蟾耀碧天；不遇刑克真稀奇，财官兴旺更长年。</p><p>庚日时逢丁丑，正官、财库相随。</p><p>午未戌月福优余，庚取时逢金柜。</p><p>金逢火而成器，必然荫子封妻。</p><p>从来歌酒不相离，定主清闲乐意。</p>",27),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","240卷 九·六庚日丁丑时断.html.vue"]]);export{f as default};
